import React from "react";
import { useParams } from "react-router-dom";
import "./Products.css";

const allProducts = {
  whiskey: [
    { id: "w1", name: "Classic Whiskey", price: 45, image: "https://via.placeholder.com/300x200?text=Whiskey+1" },
    { id: "w2", name: "Premium Whiskey", price: 60, image: "https://via.placeholder.com/300x200?text=Whiskey+2" },
  ],
  vodka: [
    { id: "v1", name: "Smooth Vodka", price: 30, image: "https://via.placeholder.com/300x200?text=Vodka+1" },
    { id: "v2", name: "Ice Vodka", price: 35, image: "https://via.placeholder.com/300x200?text=Vodka+2" },
  ],
  wine: [
    { id: "wi1", name: "Red Wine", price: 25, image: "https://via.placeholder.com/300x200?text=Wine+1" },
    { id: "wi2", name: "White Wine", price: 28, image: "https://via.placeholder.com/300x200?text=Wine+2" },
  ],
  beer: [
    { id: "b1", name: "Craft Beer", price: 18, image: "https://via.placeholder.com/300x200?text=Beer+1" },
  ],
  rum: [
    { id: "r1", name: "Dark Rum", price: 35, image: "https://via.placeholder.com/300x200?text=Rum+1" },
  ],
  tequila: [
    { id: "t1", name: "Aged Tequila", price: 55, image: "https://via.placeholder.com/300x200?text=Tequila+1" },
  ],
};

export default function Products() {
  const { categoryId } = useParams();
  const products = allProducts[categoryId] || [];

  return (
    <div className="products-page">
      <h1>{categoryId.charAt(0).toUpperCase() + categoryId.slice(1)} Products</h1>

      <div className="products-grid">
        {products.map((p) => (
          <div key={p.id} className="product-card">
            <img src={p.image} alt={p.name} />
            <h3>{p.name}</h3>
            <p>${p.price.toFixed(2)}</p>
            <div className="rating">{"★".repeat(5)}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
